import React, {Component} from "react";

export class HomeAlt extends Component{
    NumberList(props) {
        const numbers = props.numbers;
        const listItems = numbers.map((number) =>
          <li>{number}</li>
        );
        return (
          <ul>{listItems}</ul>
        );
      }
      
    

    render() {
        return (
            <div id="home">
                <h2>This is the home page.</h2>
                <div>home</div>
            </div>
        );
    }
}
